function ff_expString(text)
{
 text = trim(text)\x3B
 var i\x3B
 var o = \x27\x27\x3B
 for(i = 0\x3B i \x3C text.length\x3B i++) {
 c = text.charAt(i)\x3B
 switch(c) {
 case \x27\x3B\x27 : o += \x27\x5C\x5Cx3B\x27\x3B break\x3B
 case \x27\x2C\x27 : o += \x27\x5C\x5Cx2C\x27\x3B break\x3B
 case \x27\x26\x27 : o += \x27\x5C\x5Cx26\x27\x3B break\x3B
 case \x27\x3C\x27 : o += \x27\x5C\x5Cx3C\x27\x3B break\x3B
 case \x27\x3E\x27 : o += \x27\x5C\x5Cx3E\x27\x3B break\x3B
 case \x27\x5C\x27\x27: o += \x27\x5C\x5Cx27\x27\x3B break\x3B
 case \x27\x5C\x5C\x27: o += \x27\x5C\x5Cx5C\x27\x3B break\x3B
 case \x27\x22\x27 : o += \x27\x5C\x5Cx22\x27\x3B break\x3B
 case \x27\x5Cn\x27: o += \x27\x5C\x5Cn\x27\x3B break\x3B
 case \x27\x5Cr\x27: o += \x27\x5C\x5Cr\x27\x3B break\x3B
 default: o += c\x3B
 } // switch
 } // for
 return o\x3B
} // expString

