function ff_validate_date(element\x2C message)
{
 let separator = \x27-\x27\x3B // default
 let format = \x27YYYY-MM-DD\x27\x3B // default
 let splitted_message = message.split(\x22***\x22)\x3B
 let year_index = 0\x3B
 let month_index =1\x3B
 let day_index = 2\x3B
 let year_length = 4\x3B
 let month_length = 2\x3B
 let day_length = 2\x3B

 if( splitted_message.length == 3 ){
 format = splitted_message[0].split(\x22 \x22)[0].trim().toUpperCase()\x3B // in case there is the time\x2C as well\x2C we want the \x22left\x22 side\x2C only
 separator = splitted_message[1]\x3B
 message = splitted_message[2]\x3B
 let splitted_format = format.split( separator )\x3B
 if(splitted_format.length == 3){
 for(let i = 0\x3B i \x3C 3\x3B i++){ 
 if(splitted_format[i].startsWith(\x22Y\x22)){ year_index = i\x3B year_length = splitted_format[i].length\x3B }
 if(splitted_format[i].startsWith(\x22M\x22)){ month_index = i\x3B month_length = splitted_format[i].length\x3B }
 if(splitted_format[i].startsWith(\x22D\x22)){ day_index = i\x3B day_length = splitted_format[i].length\x3B }
 }
 }
 }

 if(message.trim() == \x27\x27){

 message = \x27Element \x27 + element.name + \x27 failed my test\x27\x3B
 }

 if(typeof element.value == \x27undefined\x27 || element.value.trim() == \x27\x27){

 return message\x3B
 }

 let splitted_value = element.value.split( separator )\x3B

 if( splitted_value.length != 3 ){

 return message\x3B
 }

 let new_value = splitted_value[year_index] + \x22-\x22 + splitted_value[month_index] + \x22-\x22 + splitted_value[day_index] \x3B

 // Regular expression used to check if date is in correct format
 let reg = new RegExp(\x22^\x5C\x5Cd{\x22+year_length+\x22}-\x5C\x5Cd{\x22+month_length+\x22}-\x5C\x5Cd{\x22+day_length+\x22}$\x22\x2C\x22g\x22)\x3B

 if(reg.test(new_value))
 {
 let date_array = new_value.split(\x22-\x22)\x3B
 let day = date_array[2]\x3B
 let month = date_array[1] - 1\x3B
 let year = date_array[0]\x3B

 if( !bfvdate_isValid(day\x2C month\x2C year) )
 {
 return message\x3B
 }
 }
 else
 {
 return message\x3B
 }

 return \x27\x27\x3B
}

function bfvdate_daysInMonth(m\x2C y) { // m is 0 indexed: 0-11
 switch (m) {
 case 1 :
 return (y % 4 == 0 \x26\x26 y % 100) || y % 400 == 0 ? 29 : 28\x3B
 case 8 : case 3 : case 5 : case 10 :
 return 30\x3B
 default :
 return 31
 }
}

function bfvdate_isValid(d\x2C m\x2C y) {
 return m \x3E= 0 \x26\x26 m \x3C 12 \x26\x26 d \x3E 0 \x26\x26 d \x3C= bfvdate_daysInMonth(m\x2C y)\x3B
}

