function ff_validate_date_DDMMYYYY(element\x2C message)
{
 // Regular expression used to check if date is in correct format
 var pattern = /[0-3][0-9]\x5C/(0|1)[0-9]\x5C/(19|20)[0-9]{2}/\x3B
 if(pattern.test(element.value))
 {
 var date_array = element.value.split(\x27/\x27)\x3B
 var day = date_array[0]\x3B

 // Attention! Javascript consider months in the range 0 - 11
 var month = date_array[1] - 1\x3B
 var year = date_array[2]\x3B

 // This instruction will create a date object
 source_date = new Date(year\x2Cmonth\x2Cday)\x3B

