function ff_getParam($name\x2C $default=null\x2C $mask=0)
{
 global $ff_request\x3B
 if (substr($name\x2C0\x2C9)==\x27ff_param_\x27) {
 if (!isset($ff_request[$name])) return $default\x3B
 $val = $ff_request[$name]\x3B
 } else {
 if (!isset($_REQUEST[$name])) return $default\x3B
 $val = $_REQUEST[$name]\x3B
 } // if
 $dotrim = ($mask \x26 FF_NOTRIM)==0\x3B
 $dostrp = ($mask \x26 FF_ALLOWHTML)==0\x3B
 $addsla = ($mask \x26 FF_ALLOWRAW)==0\x3B
 $remsla = ($mask \x26 FF_ALLOWRAW)!=0\x3B
 if (is_array($val)) {
 $cnt = count($val)\x3B
 for ($v = 0\x3B $v \x3C $cnt\x3B $v++)
 if (is_string($val[$v])) {
 if ($dotrim) $val[$v] = trim($val[$v])\x3B
 if ($dostrp) $val[$v] = strip_tags($val[$v])\x3B
 if ($addsla) $val[$v] = addslashes($val[$v])\x3B
 if ($remsla) $val[$v] = stripslashes($val[$v])\x3B
 } // if
 } else {
 if (is_string($val)) {
 if ($dotrim) $val = trim($val)\x3B
 if ($dostrp) $val = strip_tags($val)\x3B
 if ($addsla) $val = addslashes($val)\x3B
 if ($remsla) $val = stripslashes($val)\x3B
 } // if
 } // if
 return $val\x3B
} // ff_getParam

piece.description:
Returns submitdata either as scalar\x2C array or list. In case of list the values
are returned as a string with the values concatenated by comma.

Examples:

// Get as scalar: Optionally pass a default value as second parameter.
// If no default is provided\x2C it will return NULL if no value was submitted

 $myval = ff_getSubmit(\x27myvar\x27)\x3B // return NULL if not submitted

 $myval = ff_getSubmit(\x27myvar\x27\x2C1)\x3B // return 1 if not submitted

 $myval = ff_getSubmit(\x27myvar\x27\x2C\x27foo\x27)\x3B // return \x27foo\x27 if not submitted

 ff_query(
 \x22insert into #__mytable(id\x2C name) \x22.
 \x22values (\x27\x22.
 ff_getSubmit(\x27id\x27).\x22\x2C \x22.
 ff_getSubmit(\x27name\x27\x2C\x27unknown\x27).
 \x22\x27)\x22
 )\x3B

// Get as array: Pass FF_ARRAY as second Parameter

 $myarr = $ff_getSubmit(\x27myarr\x27\x2C FF_ARRAY)\x3B

 foreach ($myarr as $myval) ...

// Get as list: Pass either FF_LIST\x2C FF_SLIST or FF_DLIST as 2nd parameter.

 // FF_LIST will return numeric data unquoted and strings in single quotes:
 // 1\x2C2\x2C\x27a\x27\x2C4

 // FF_SLIST will return all data single quoted:
 // \x271\x27\x2C\x272\x27\x2C\x27a\x27\x2C\x274\x27

 // FF_DLIST will return all data double quoted:
 // \x221\x22\x2C\x222\x22\x2C\x22a\x22\x2C\x224\x22

 ff_query(
 \x22delete from #__mytable \x22.
 \x22where id in (\x22.ff_getSubmit(\x27itemlist\x27\x2CFF_LIST).\x22)\x22
 )\x3B

